import React from 'react'
import Header from './components/Header.js'
import './App.css';

function App() {
  return (
   <>
   <Header />
   <main>
    <section className="presentation">
      <div className="introduction">
        <h1>ALMOST DONE</h1>
        <p>Embracing immediate ideas</p>

      <div className="cta">
<button className="cta-learn">Learn More</button>
<button className="cta-explore">Explore Projects</button>
      </div>

      </div>
    </section>
   </main>
   </>

  );
}

export default App;
